Benedict XVI (Latin: Benedictus XVI; born Joseph Aloisius Ratzinger; 16 April 1927) is pope emeritus of the Catholic Church. He served as the 265th pope from 2005 to 2013. In that role he was both the leader of the Catholic Church and Sovereign of the Vatican City State. Benedict was elected on 19 April 2005 in a papal conclave, celebrated his Papal Inauguration Mass on 24 April 2005, and took possession of his cathedral, the Archbasilica of St. John Lateran, on 7 May 2005.

On 11 February 2013, Pope Benedict announced his resignation in a speech in Latin before the cardinals, citing a &quot;lack of strength of mind and body&quot; due to his advanced age. His resignation became effective on 28 February 2013. He is the first pope to resign since Pope Gregory XII in 1415, and the first to do so on his own initiative since Pope Celestine V in 1294. As pope emeritus, Benedict retains the style of His Holiness, and the title of Pope, and will continue to dress in the papal colour of white. He is expected to move into the newly renovated Mater Ecclesiae monastery for his retirement.
